import React from "react";
import {Button} from "antd"
import logo512 from "../../public/"
function Index(){
    return (
        <div className="First">
            <h1>不积硅步无以至千里,不积小流无以成江海</h1>
            <Button>关于我</Button>
            <Button>作品</Button>
            <img src={logo512}/>
        </div>
    )
}

export default Index;
